6) A versão dele é completamente diferente da versão dela. A mulher nos áudios diz que ele falou palavrões, fez gestos obscenos e até tentou seduzi-la na frente da sogra e da filha, mas essa versão não bate com o Gilvaldo que aparece nessa entrevista;
